func accountBalanceAfterPurchase(purchaseAmount int) int {
    // Find the remainder of purchaseAmount when divided by 10
    remainder := purchaseAmount % 10

    // Calculate the rounded amount
    var roundedAmount int
    if remainder >= 5 {
        roundedAmount = purchaseAmount + 10 - remainder
    } else {
        roundedAmount = purchaseAmount - remainder
    }

    // Subtract the rounded amount from the initial balance
    return 100 - roundedAmount
}
